// src/routes.ts
import CryptoJS from "crypto-js";
import { v5 } from "uuid";
var inputsMap = (body) => (input) => {
  let name, kind = "text", label;
  if (typeof input === "string") {
    name = input;
    label = name;
  } else {
    name = input.name;
    kind = input.kind || kind;
    label = input.label || name;
  }
  return `<label>${label}
  <textarea type="${kind}" name="${name}" >${body[name] || ""}</textarea>
</label>`;
};
var resetStyle = readFileSync(
  new URL("../style/reset.css", import.meta.url).pathname,
  "utf8"
);
var defaultStyle = readFileSync(
  new URL("../style/index.css", import.meta.url).pathname,
  "utf8"
);
var html = (form = "") => {
  return `<html>
  <head>
    <title>Playground</title>
    <script>
      const reset = ()=>{
        document.querySelectorAll('input, textarea').forEach((input)=>{
          input.value = '';
        });
      }
    </script>
    <link rel="icon" href="data:;base64,${parrot_default}">
    <style>
      ${resetStyle}
      ${defaultStyle}
    </style>
  </head>
  <body>
    <main>
      ${form}
    </main>
  </body>
</html>`;
};
var playground_route = (chain) => {
  const inputs = chain.first.inputVariables;
  return async (req, res) => {
    const result = req.method === "POST" ? `<output>${await chain.invoke(req.body)}</output>` : null;
    res.set("Content-Type", "text/html");
    res.send(
      Buffer.from(
        html(`<form method="POST">
        <h1>\u{1F99C} <span class="first-word">LangServe</span> Playground</h1>
        <h2>Try It </h2>
        <div>
        <header><h3>Inputs</h3> <span class="reset" onclick="reset()">Reset</span></header>
        ${inputs.map(inputsMap(req.body || {}))}
        </div>${result !== null ? `<h2>Output</h2>
        <div>
        ${result}
        </div>` : ""}
        <footer>
        <!--<button type="button">${share_default} Share</button>-->
        <button type="submit">${arrowplane_default} Start</button>
        </footer>
      </form>
      `)
      )
    );
  };
};
var invoke_route = (chain) => {
  return async (req, res) => {
    const run_id = v5(
      CryptoJS.MD5(JSON.stringify(req.body.input)).toString(),
      "1b671a64-40d5-491e-99b0-da01ff1f3341"
    );
    const output = await chain.invoke(req.body.input);
    res.set("Content-Type", "application/json");
    res.send(
      JSON.stringify({
        output,
        callback_events: [],
        metadata: { run_id }
      })
    );
  };
};

// src/server.ts
var add_express_routes = (app, chain, options = { path: "" }) => {
  const { path } = options;
  app.get(`${path}/playground`, playground_route(chain));
  app.post(
    `${path}/playground`,
    bodyParser.urlencoded({
      // to support URL-encoded bodies
      extended: true
    })
  );
  app.post(`${path}/playground`, playground_route(chain));
  app.post(`${path}/invoke`, bodyParser.json());
  app.post(`${path}/invoke`, invoke_route(chain));
  return app;
};

// src/client.ts
var RemoteRunnable = class {
  #invokeAddress = "";
  #fetch;
  constructor(address = "", options = { fetch: globalThis.fetch }) {
    this.#invokeAddress = `${address}/invoke`;
    this.#fetch = options.fetch;
  }
  async invoke(input, options = { tags: [], metadata: {}, recursion_limit: 25 }) {
    const { tags, metadata, recursion_limit } = options;
    const response = await this.#fetch(this.#invokeAddress, {
      method: "POST",
      headers: { "Content-Type": "application/json" },
      body: JSON.stringify({
        input,
        config: { tags, metadata, recursion_limit },
        kwargs: {}
      })
    });
    return await response.json().then(({ output }) => output);
  }
};
export {
  RemoteRunnable,
  add_express_routes
};
